define([],function(){var t={init:function(){console.log("product");var t=$("#j_contact_us");t.submit(function(e){e.preventDefault();var a=$('<div class="form_status clearfix"></div>');$.ajax({url:$(this).attr("action"),type:$(this).attr("method"),dataType:"json",data:t.serialize(),beforeSend:function(){t.prepend(a.html('<p><i class="fa fa-spinner fa-spin"></i> 表单正在提交中...</p>').fadeIn())}}).done(function(e){1==e.status?(a.html('<p class="text-success"><i class="fa fa-check"></i>'+e.msg+"</p>").delay(3e3).fadeOut(),setTimeout(function(){t[0].reset()},1e3)):a.html('<p class="text-danger"><i class="fa fa-close"></i>'+e.msg+"</p>").delay(3e3).fadeOut()})})}};return t});